    "classic-project-layout-config.what-are-context-fields.jsd": "\uc5d0\uc774\uc804\ud2b8\uac00 \uc694\uccad\uc5d0 \uc9c0\uc6d0 \uc815\ubcf4\ub97c \ucd94\uac00\ud558\ub294 \ub370 \uc0ac\uc6a9\ud558\ub294 \ud544\ub4dc\uc785\ub2c8\ub2e4. \uc5ec\ub7ec \uc904 \ud14d\uc2a4\ud2b8 \ud544\ub4dc\ub294 \uc5ec\uae30\uc5d0 \ucd94\uac00\ud560 \uc218 \uc5c6\uc2b5\ub2c8\ub2e4.\n\ube44\uc5b4 \uc788\uc73c\uba74 '\ub354 \ubcf4\uae30' \ub9c1\ud06c \ubc11\uc5d0 '\ube44\uc5b4 \uc788\ub294 \uacbd\uc6b0 \uc228\uae30\uae30' \ubc11\uc5d0 \ud544\ub4dc\uac00 \ub098\ud0c0\ub0a9\ub2c8\ub2e4.\n\uc774 \ud544\ub4dc\ub294 \uace0\uac1d\uc5d0\uac8c \ud45c\uc2dc\ub418\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4.",
    "classic-project-layout-config.what-are-description-fields": "\uc774\ub7ec\ud55c \ud544\ub4dc\ub294 \uc644\ub8cc\ud574\uc57c \ud558\ub294 \uc791\uc5c5\uc744 \uc124\uba85\ud569\ub2c8\ub2e4. \ub300\ubd80\ubd84\uc758 \ubcf4\uae30\uc5d0\uc11c \ub208\uc5d0 \uc798 \ub744\uac8c \ud45c\uc2dc\ub429\ub2c8\ub2e4.",
    "classic-project-layout-config.what-are-description-fields.jsd": "\uc5d0\uc774\uc804\ud2b8\uac00 \uc694\uccad\uc5d0 \ucd94\uac00 \uc815\ubcf4\ub97c \ucd94\uac00\ud558\ub294 \ub370 \uc0ac\uc6a9\ud558\ub294 \ud544\ub4dc\uc785\ub2c8\ub2e4. \uc774\ub97c \ud1b5\ud574 \ud300\uc6d0\uc5d0\uac8c \uae34 \ud615\uc2dd\uc758 \uc815\ubcf4\ub97c \uc804\ub2ec\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n\uc5ec\ub7ec \uc904 \ud14d\uc2a4\ud2b8 \ud544\ub4dc\ub9cc \uc5ec\uae30\uc5d0 \ucd94\uac00\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \uc774 \ud544\ub4dc\ub294 \uace0\uac1d\uc5d0\uac8c \ud45c\uc2dc\ub418\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4.",
    "classic-project-layout-config.what-are-primary-fields": "\uc774\ub7ec\ud55c \ud544\ub4dc\ub294 \ud574\ub2f9 \uc774\uc288 \uc720\ud615\uc5d0 \uc911\uc694\ud55c \uc815\ubcf4\ub97c \ucea1\ucc98\ud569\ub2c8\ub2e4. \uc774\uc288 \ubcf4\uae30\uc5d0\uc11c \ud56d\uc0c1 \ud45c\uc2dc\ub429\ub2c8\ub2e4.",
    "classic-project-layout-config.what-are-secondary-fields": "\uc774\ub7ec\ud55c \ud544\ub4dc\ub97c \ud56d\uc0c1 \uc791\uc131\ud574\uc57c \ud558\ub294 \uac83\uc740 \uc544\ub2d9\ub2c8\ub2e4. \ube44\uc6cc \ub458 \uacbd\uc6b0 \uc774\uc288 \ubcf4\uae30\uc758 '\ub354 \ubcf4\uae30' \uc544\ub798\uc5d0 \ub098\ud0c0\ub0a9\ub2c8\ub2e4.",
