    "portfolio-3-portfolio.app-simple-plans.command.warnings.body.assignee-ignored": "\uc774\uc288 \ub2f4\ub2f9\uc790\uac00 \ud50c\ub79c\uc758 \ud300\uc5d0 \uc18d\ud558\uc9c0 \uc54a\uae30 \ub54c\ubb38\uc5d0 \uc774\uc288\uac00 \ub2e4\ub978 \uc0ac\ub78c\uc5d0\uac8c \uc608\uc57d\ub418\uc5c8\uc2b5\ub2c8\ub2e4. \uc774\uc288\uac00 \uc608\uc57d\ub41c \uc0ac\ub78c\uc774 \ud300\uc5d0 \uc18d\ud574 \uc788\uc73c\uba70 \uc774 \uc774\uc288\uac00 \ud560\ub2f9\ub420 \uc218 \uc788\ub294\uc9c0 \ud655\uc778\ud558\uc2ed\uc2dc\uc624. \uadf8\ub7f0 \ub2e4\uc74c \ud50c\ub79c\uc744 \ub2e4\uc2dc \uacc4\uc0b0\ud558\uc2ed\uc2dc\uc624.",
    "portfolio-3-portfolio.app-simple-plans.command.warnings.body.availability-violation": "\ud300 \ubcf4\uae30\uc5d0\uc11c \ud604\uc7ac \uc774 \uc774\uc288\uc5d0 \ub300\ud574 \uc791\uc5c5\ud560 \uc218 \uc788\ub294 \ud300\uc6d0\uc774 \uc788\ub294\uc9c0 \ud655\uc778\ud55c \ud6c4\uc5d0 \ud50c\ub79c\uc744 \ub2e4\uc2dc \uacc4\uc0b0\ud558\uc2ed\uc2dc\uc624.",
    "portfolio-3-portfolio.app-simple-plans.command.warnings.body.cyclic-dependency": "\uc774 \uc774\uc288\ub294 \ud574\ub2f9 \uc774\uc288\uc5d0 \ub2e4\uc2dc \uc9c1\uac04\uc811\uc801\uc73c\ub85c \uc885\uc18d\ub41c \uc774\uc288\uc5d0 \uc885\uc18d\ub418\uc5b4 \uc788\uc2b5\ub2c8\ub2e4. \uc885\uc18d\uc131\uc744 \uc81c\uac70\ud558\uace0 \ud50c\ub79c\uc744 \ub2e4\uc2dc \uacc4\uc0b0\ud558\uc2ed\uc2dc\uc624.",
    "portfolio-3-portfolio.app-simple-plans.command.warnings.body.date-beyond-due-date": "\uc774 \uc774\uc288\uc758 \uc2dc\uc791\uc77c \ubc0f \uc885\ub8cc\uc77c \uc911 \ud558\ub098 \ub610\ub294 \ub458 \ubaa8\ub450\uac00 \uae30\ud55c \uc774\ud6c4\ub85c \uc124\uc815\ub418\uc5b4 \uc788\uc2b5\ub2c8\ub2e4. \uae30\ud55c\uc744 \uc5c5\ub370\uc774\ud2b8\ud558\uac70\ub098 \ub0a0\uc9dc\ub97c \uae30\ud55c\uc73c\ub85c \ub610\ub294 \uadf8 \uc774\uc804\uc73c\ub85c \uc124\uc815\ud558\uc138\uc694.",
    "portfolio-3-portfolio.app-simple-plans.command.warnings.body.date-outside-of-sprint": "\uc774\uc288\uc758 \uc2dc\uc791\uc77c \ub610\ub294 \uc885\ub8cc\uc77c\uc774 \ud560\ub2f9\ub41c \uc2a4\ud504\ub9b0\ud2b8\uc5d0 \uc18d\ud558\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4",
    "portfolio-3-portfolio.app-simple-plans.command.warnings.body.dependencies-ignored-release": "\uc774 \uc791\uc5c5 \ud56d\ubaa9\uc740 \ub9b4\ub9ac\uc988\ubcf4\ub2e4 \uba3c\uc800 \ubc1c\uc0dd\ud588\uc73c\uba70 \uc774 \uc791\uc5c5 \ud56d\ubaa9\uc758 \uc885\uc18d\uc131\uc774 \ud560\ub2f9\ub418\uc5b4 \uc788\ub294 \ub9b4\ub9ac\uc988\uc5d0 \ud560\ub2f9\ub418\uc5b4 \uc788\uc2b5\ub2c8\ub2e4.",
    "portfolio-3-portfolio.app-simple-plans.command.warnings.body.dependencies-ignored-sprint": "\uc774 \uc791\uc5c5 \ud56d\ubaa9\uc740 \ud574\ub2f9 \uc885\uc18d\uc131\uc774 \uc608\uc57d\ub41c \uc2a4\ud504\ub9b0\ud2b8\ubcf4\ub2e4 \uba3c\uc800 \ubc1c\uc0dd\ud55c \uace0\uc815 \uc2a4\ud504\ub9b0\ud2b8\uc5d0 \ud560\ub2f9\ub418\uc5b4 \uc788\uc2b5\ub2c8\ub2e4.",
    "portfolio-3-portfolio.app-simple-plans.command.warnings.body.dependencies-share-sprint": "{issue} \ubc0f \uc885\uc18d\uc131 {dependency}\uc774(\uac00) \ub3d9\uc77c\ud55c \uc2a4\ud504\ub9b0\ud2b8\uc5d0 \ud560\ub2f9\ub418\uc5c8\uc2b5\ub2c8\ub2e4.",
    "portfolio-3-portfolio.app-simple-plans.command.warnings.body.earliest-start-ignored": "\uc774 \uc774\uc288\uc758 \uc218\ub3d9\uc73c\ub85c \ud560\ub2f9\ub41c \uc2a4\ud504\ub9b0\ud2b8\uc758 \uc2dc\uc791\uc77c\uc740 \uc774\uc288\uc758 \uac00\uc7a5 \ube60\ub978 \uc2dc\uc791 \ub0a0\uc9dc\ubcf4\ub2e4 \uc6b0\uc120\uc21c\uc704\uac00 \uc55e\uc12d\ub2c8\ub2e4. \uac00\uc7a5 \ube60\ub978 \uc2dc\uc791\uc77c\uc744 \uc124\uc815\ud558\ub824\uba74 \uc774\uc288\uc758 \uc2a4\ud504\ub9b0\ud2b8\ub97c '\uacc4\uc0b0'\uc73c\ub85c \uc124\uc815\ud558\uc2ed\uc2dc\uc624. \ub610\ub294 \uc774 \uba54\uc2dc\uc9c0\ub97c \uc81c\uac70\ud558\ub824\uba74 \uc774 \uc774\uc288\uc5d0\uc11c \uc2dc\uc791 \ub0a0\uc9dc\ub97c \uc81c\uac70\ud558\uc2ed\uc2dc\uc624. \uadf8\ub7f0 \ub2e4\uc74c \ud50c\ub79c\uc744 \ub2e4\uc2dc \uacc4\uc0b0\ud558\uc2ed\uc2dc\uc624.",
