    "portfolio-3-portfolio.app-simple-plans.command.warnings.body.ends-after-sprint": "{issue}\uc774(\uac00) \ud560\ub2f9\ub41c \uc2a4\ud504\ub9b0\ud2b8 {sprint} \uc774\ud6c4 {amount}\uc5d0 \uc885\ub8cc\ub429\ub2c8\ub2e4.",
    "portfolio-3-portfolio.app-simple-plans.command.warnings.body.external-team": "\ud560\ub2f9\ub41c \ud300\uc744 \ud50c\ub79c\uc5d0 \uc18d\ud574 \uc788\ub294 \ud300\uc73c\ub85c \ubcc0\uacbd\ud558\uac70\ub098, \ud560\ub2f9\ub41c \ud300\uc744 \ud50c\ub79c\uc5d0 \ucd94\uac00\ud558\uc2ed\uc2dc\uc624. \uadf8\ub7f0 \ub2e4\uc74c \ud50c\ub79c\uc744 \ub2e4\uc2dc \uacc4\uc0b0\ud558\uc2ed\uc2dc\uc624.",
    "portfolio-3-portfolio.app-simple-plans.command.warnings.body.horizon-reached": "\ubaa8\ub4e0 \ud50c\ub79c\uc758 \ucd5c\ub300 \uacc4\ud68d \ubc94\uc704\ub294 5\ub144\uc785\ub2c8\ub2e4. \uc77c\uc815 \uae30\uac04\uc744 \uc904\uc774\ub824\uba74 \uc791\uc5c5 \ubc94\uc704\ub97c \uc904\uc774\uac70\ub098, \uc778\uc6d0\uc744 \ub354 \ucd94\uac00\ud558\uac70\ub098, \ud300\uc758 \uc6a9\ub7c9\uc744 \ub298\ub9b0 \ud6c4\uc5d0 \ud50c\ub79c\uc744 \ub2e4\uc2dc \uacc4\uc0b0\ud558\uc2ed\uc2dc\uc624.",
