    "portfolio-3-portfolio.app-simple-plans.command.warnings.body.misconfigured-children": "\uc774 \uc774\uc288\ub294 \uad1c\ucc2e\uc9c0\ub9cc, \ud574\ub2f9 \ud558\uc704 \ud56d\ubaa9\uc5d0 \uacbd\uace0\uac00 \uc788\uc2b5\ub2c8\ub2e4.",
    "portfolio-3-portfolio.app-simple-plans.command.warnings.body.not-closed-beyond-end-date": "\uc774 \uc774\uc288\ub294 \ud574\ub2f9 \uc885\ub8cc\uc77c\uc774 \uc9c0\ub09c \ud6c4\uc5d0\ub3c4 \uc544\uc9c1 \ud574\uacb0\ub418\uc9c0 \uc54a\uc558\uc2b5\ub2c8\ub2e4. \uc774\uc288\uc5d0 \ub300\ud55c \uc0c1\ud0dc\ub97c \uc5c5\ub370\uc774\ud2b8\ud574\uc57c \ud558\ub294\uc9c0 \ub610\ub294 \uc774\uc288\ub97c \ud574\uacb0\ud558\ub294 \ub370 \uc2dc\uac04\uc774 \ub354 \ud544\uc694\ud55c\uc9c0 \ud655\uc778\ud558\uc138\uc694.",
    "portfolio-3-portfolio.app-simple-plans.command.warnings.body.not-fully-scheduled": "\uc774 \ud2b9\uc815 \uc2dc\uac04\uc5d0 \uc774 \uc774\uc288\uc5d0 \ub300\ud55c \uc791\uc5c5\uc744 \ud560 \uc218 \uc788\ub294 \uc778\uc6d0\uc744 \ud300\uc5d0\uc11c \ud655\uc778\ud55c \ud6c4\uc5d0 \ud50c\ub79c\uc744 \ub2e4\uc2dc \uacc4\uc0b0\ud558\uc2ed\uc2dc\uc624.",
    "portfolio-3-portfolio.app-simple-plans.command.warnings.body.overbooked": "\uc774 \uc774\uc288\uac00 \uc2a4\ud504\ub9b0\ud2b8\uc5d0 \uc218\ub3d9\uc73c\ub85c \ud560\ub2f9\ub418\uc5c8\uc73c\uba70, \uc774\uc288\uc5d0 \ub300\ud574 \uc791\uc5c5\ud560 \uc218 \uc788\ub294 \uc778\uc6d0\uc774 \ud574\ub2f9 \uc2a4\ud504\ub9b0\ud2b8\uc5d0 \ucd08\uacfc \uc608\uc57d\ub418\uc5c8\uc2b5\ub2c8\ub2e4. \uc791\uc5c5 \uc778\uc6d0\uc758 \ubc94\uc704\ub97c \uc904\uc774\uc2ed\uc2dc\uc624. \ub610\ub294 \ud300\uc5d0 \uc778\uc6d0\uc774 \uc5c6\ub294 \uacbd\uc6b0 \uc2a4\ud504\ub9b0\ud2b8 \ubc94\uc704\ub97c \uc904\uc774\uc2ed\uc2dc\uc624. \uadf8\ub7f0 \ub2e4\uc74c \ud50c\ub79c\uc744 \ub2e4\uc2dc \uacc4\uc0b0\ud558\uc2ed\uc2dc\uc624.",
    "portfolio-3-portfolio.app-simple-plans.command.warnings.body.pc-end-conflict": "PC \ucd9c\uc2dc \ub0a0\uc9dc {shipDate}\uc774(\uac00) \uc885\ub8cc\uc77c {targetEnd}\uacfc(\uc640) \uac19\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4.",
    "portfolio-3-portfolio.app-simple-plans.command.warnings.body.release-conflict": "\uc2a4\ud1a0\ub9ac \ub808\ubca8 \uc774\uc288\uc640 \ud574\ub2f9 \ud558\uc704 \uc791\uc5c5\uc740 \ub3d9\uc77c\ud55c \ub9b4\ub9ac\uc988\uc5d0 \ud560\ub2f9\ud574\uc57c \ud569\ub2c8\ub2e4. \ub9b4\ub9ac\uc988 \ud560\ub2f9\uc774 \uc77c\uce58\ud558\ub294\uc9c0 \ud655\uc778\ud55c \ud6c4\uc5d0 \ud50c\ub79c\uc744 \ub2e4\uc2dc \uacc4\uc0b0\ud558\uc2ed\uc2dc\uc624.",
