    "portfolio-3-portfolio.app-simple-plans.command.warnings.body.sprint-exceeded": "\uc2a4\ud1a0\ub9ac\ub97c \ucd94\uac00\ub85c \ubd84\ud560\ud558\uc5ec \uc608\uc0c1\uce58\ub97c \uc904\uc774\uac70\ub098, \uc2a4\ud504\ub9b0\ud2b8 \ubc94\uc704\ub97c \uc904\uc5ec\uc11c \uc774 \uc774\uc288\uac00 \uc2a4\ud504\ub9b0\ud2b8\uc5d0 \uc801\ud569\ud558\uac8c \ud558\uc2ed\uc2dc\uc624. \uadf8\ub7f0 \ub2e4\uc74c \ud50c\ub79c\uc744 \ub2e4\uc2dc \uacc4\uc0b0\ud558\uc2ed\uc2dc\uc624.",
