    "portfolio-3-portfolio.app-simple-plans.command.warnings.body.subtask-cyclic-dependency-ignored.rebranded": "\ub2e8\uc77c \uc774\uc288\uc5d0 \ud3ec\ud568\ub41c \ud558\uc704 \uc791\uc5c5 \uac04\uc758 \uc885\uc18d\uc131\uc740 \ucc98\ub9ac\ud560 \uc218 \uc5c6\uc2b5\ub2c8\ub2e4. \uc774 \uc774\uc288\uc5d0\uc11c \uc774\ub7ec\ud55c \uc885\uc18d\uc131\uc744 \uc81c\uac70\ud55c \ud6c4\uc5d0 \uacc4\ud68d\uc744 \uc790\ub3d9\uc73c\ub85c \uc608\uc57d\ud558\uc138\uc694.",
