    "servicedesk-incident-management-incidents.opsgenie-incidents.opsgenie-no-settings-crossflow.agent-description": "\uae09\ud55c \uc0c1\ud669\uc5d0\uc11c Opsgenie\ub294 \uc778\uc2dc\ub358\ud2b8\uc758 \ube60\ub978 \ud574\uacb0\ud558\uae30 \uc704\ud574 \uc5d0\uc774\uc804\ud2b8\ub97c \uc54c\ub9de\uc740 \ud300\uc5d0 \uc5f0\uacb0\ud569\ub2c8\ub2e4. \uc0ac\uc774\ud2b8 \uad00\ub9ac\uc790\uc5d0\uac8c \ubb38\uc758\ud558\uc5ec Opsgenie \ud3c9\uac00\ud310\uc744 \uc2dc\uc791\ud558\uac70\ub098 \uae30\uc874 Opsgenie \uc0ac\uc774\ud2b8\uc5d0 \uc5f0\uacb0\ud558\uc138\uc694.",
