    "software-reports-report-page.header.how-to.burndown-how": "\ube68\uac04\uc0c9 \uc120\uc740 \uc2a4\ud504\ub9b0\ud2b8\uc5d0 \ub0a8\uc740 \uc791\uc5c5\ub7c9\uc744 \ubcf4\uc5ec\uc90d\ub2c8\ub2e4. \ud68c\uc0c9 \uc120\uc740 \uc774\uc0c1\uc801\uc778 \uc9c4\ud589\ub960\uc744 \ubcf4\uc5ec\uc90d\ub2c8\ub2e4. {learnMore}",
