    "xflow-user-benefits.content.customer-logos-image-alt": "Jira Service Desk\ub97c \uc0ac\uc6a9\ud558\ub294 \uace0\uac1d \ub85c\uace0",
    "xflow-user-benefits.content.customer-story-description": '\u201dJira Service Desk\uc640 Jira Software\ub97c \ud1b5\ud569\ud558\uba74\uc11c IT \ubc0f \uc18c\ud504\ud2b8\uc6e8\uc5b4 \uac1c\ubc1c \ud300\uc774 \ubcf4\ub2e4 \uc790\uc8fc \ud611\uc5c5\ud558\uace0 \ubcf4\ub2e4 \ube60\ub974\uac8c \ubb38\uc81c\ub97c \ud574\uacb0\ud560 \uc218 \uc788\uac8c \ub418\uc5c8\uc2b5\ub2c8\ub2e4."',
    "xflow-user-benefits.content.customer-story-header": "\uc2e0\ub8b0\ud560 \uc218 \uc788\ub294 \ud558\ub098\uc758 \ud50c\ub7ab\ud3fc\uc5d0\uc11c \uc778\uc2dc\ub358\ud2b8\ub97c \ube60\ub974\uac8c \uc218\uc815\ud558\uace0 \ubcc0\uacbd\uc0ac\ud56d\uc744 \ud478\uc2dc",
    "xflow-user-benefits.content.customer-story-quote-attribution": "\u2014 Carol Johnson(The Daily Telegraph\uc758 IT \ubd80\uc7a5)",
    "xflow-user-benefits.content.dev-and-support-description": "\uac1c\ubc1c \uc791\uc5c5\uc5d0 \uad00\ub828\ub41c \uace0\uac1d \uc774\uc288\uc5d0 \uc6b0\uc120 \uc21c\uc704\ub97c \ub458 \uc218 \uc788\ub3c4\ub85d Jira Service Desk \ud2f0\ucf13\uc744 Jira Software \uc774\uc288\uc5d0 \uc5f0\uacb0\ud569\ub2c8\ub2e4. \uc774\uc288\uc5d0 \uc5d0\uc2a4\uceec\ub808\uc774\uc158\uc774 \ud544\uc694\ud55c \uacbd\uc6b0 \uac1c\ubc1c\uc790\uac00 \uc811\uadfc\ud558\uc5ec \uace0\uac1d\uc758 \ucf54\uba58\ud2b8\ub97c \ud655\uc778\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.",
    "xflow-user-benefits.content.dev-and-support-header": "\uac1c\ubc1c\ud300\uacfc \uc9c0\uc6d0\ud300\uc774 \ub354\uc6b1 \uc870\ud654\ub86d\uac8c",
