    "xflow-user-benefits.content.intro-description": "Jira Service Desk\ub294 Jira\ub97c \uae30\ubc18\uc73c\ub85c \ub9cc\ub4e4\uc5b4\uc84c\uc73c\ubbc0\ub85c, \uc18c\ud504\ud2b8\uc6e8\uc5b4, IT \ubc0f \uc9c0\uc6d0 \ud300\uc774 \uc11c\ub85c \uc18c\ud1b5\ud558\uace0 \ubcf4\ub2e4 \ube60\ub974\uac8c \uc774\uc288\ub97c \ud574\uacb0\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.",
    "xflow-user-benefits.content.intro-header": "Jira \uc0ac\uc6a9\uc790\ub97c \uc704\ud574 \uc124\uacc4\ub41c \ud5ec\ud504 \ub370\uc2a4\ud06c \uc18c\ud504\ud2b8\uc6e8\uc5b4",
